import { LOGIN_REQUEST } from './auth.types'
import axios from '../../helpers/axios'

export const login = (user) => {
  console.log(user)

  return async (dispatch) => {
    const res = await axios
    dispatch({
      type: LOGIN_REQUEST,
      payload: {
        ...user,
      },
    })
  }
}
